/*Elminio la base de datos*/

DROP DATABASE IF EXISTS graduates;
/*Creo la base de datos*/
CREATE DATABASE graduates;
/*Selecciono la base datos*/
USE graduates;

SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";
--
-- Database: `graduates`
--
-- --------------------------------------------------------

CREATE TABLE
  users (
    id_user int (11) PRIMARY KEY AUTO_INCREMENT,
    email varchar(30) NOT NULL,
    user_password varchar(100) NOT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

--
-- Table structure for table `students`
--
CREATE TABLE
  students (
    id int (11)  PRIMARY KEY AUTO_INCREMENT,
    ci varchar (11) DEFAULT NULL,
    first_name varchar(50) DEFAULT NULL,
    second_name varchar(50) DEFAULT NULL,
    first_last_name varchar(50) DEFAULT NULL,
    second_last_name varchar(50) DEFAULT NULL,
    birthday_date varchar(20) DEFAULT NULL,
    gender varchar(5) DEFAULT NULL,
    blood_type varchar(10) DEFAULT NULL,
    civil_status varchar(50) DEFAULT NULL,
    nationality varchar(50) DEFAULT NULL,
    place_birth varchar(50) DEFAULT NULL,
    place_residence varchar(100) DEFAULT NULL,
    direction TEXT DEFAULT NULL,
    home_phone varchar(20) DEFAULT NULL,
    cell_phone varchar(20) DEFAULT NULL,
    personal_email varchar(60) DEFAULT NULL,
    institutional_email varchar(60) DEFAULT NULL,
    imagen TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;


-- Formacion Academica
CREATE TABLE
  academic_training (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    type TEXT DEFAULT NULL,
    date TEXT DEFAULT NULL,
    place TEXT DEFAULT NULL,
    country TEXT DEFAULT NULL,
    obtained_title TEXT DEFAULT NULL,
    educational_institution TEXT DEFAULT NULL,
    senescyt_registration_n TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

-- Experiencia Docente
CREATE TABLE
  teaching_experience (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    educational_institution TEXT DEFAULT NULL,
    subject TEXT DEFAULT NULL,
    start_date TEXT DEFAULT NULL,
    end_date TEXT DEFAULT NULL,
    modality TEXT DEFAULT NULL,
    place TEXT DEFAULT NULL,
    country TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

  -- Cursos Talleres Seminarios etc
CREATE TABLE
  courses_workshops (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    type TEXT DEFAULT NULL,
    name TEXT DEFAULT NULL,
    organized_by TEXT DEFAULT NULL,
    duration TEXT DEFAULT NULL,
    start_date TEXT DEFAULT NULL,
    end_date TEXT DEFAULT NULL,
    type_participation TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

-- Produccion intelectual
CREATE TABLE
  intellectual_production (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    type TEXT DEFAULT NULL,
    name TEXT DEFAULT NULL,
    type_authorship TEXT DEFAULT NULL,
    date TEXT DEFAULT NULL,
    web_link TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

  -- Libros
CREATE TABLE
  books (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    tittle TEXT DEFAULT NULL,
    type TEXT DEFAULT NULL,
    type_authorship TEXT DEFAULT NULL,
    isb_n TEXT DEFAULT NULL,
    editoral_name TEXT DEFAULT NULL,
    editoral_origin TEXT DEFAULT NULL,
    year TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

-- Meritos academicos y profesionales
CREATE TABLE
  academic_professional_merits (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    name TEXT DEFAULT NULL,
    date TEXT DEFAULT NULL,
    type TEXT DEFAULT NULL,
    granted_by TEXT DEFAULT NULL,
    country TEXT DEFAULT NULL,
    location TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

  -- Idiomas
CREATE TABLE
  languages (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    type_certification TEXT DEFAULT NULL,
    speaking_level TEXT DEFAULT NULL,
    writing_level TEXT DEFAULT NULL,
    comprehension_level TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;

-- Experiencia Profesional
CREATE TABLE
  professional_experience (
    id int (11) PRIMARY KEY AUTO_INCREMENT,
    nro TEXT DEFAULT NULL,
    company_institution TEXT DEFAULT NULL,
    position TEXT DEFAULT NULL,
    responsibilities TEXT DEFAULT NULL,
    immediate_head TEXT DEFAULT NULL,
    telephone TEXT DEFAULT NULL,
    start_date TEXT DEFAULT NULL,
    end_date TEXT DEFAULT NULL
  ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci;



